export default function WorldMap({
  onSelectContinent,
  color,
  selectedColor,
  Continentcolors,
}) {
  const [selected, setSelected] = React.useState("");
  let colors;
  if (Continentcolors) {
    colors = Continentcolors;
  } else {
    colors = {};
  }

  return (
    <View style={styles.container}>
      <Svg
        xmlns="http://www.w3.org/2000/svg"
        width="130%"
        height="450"
        viewBox="60 50 555 250"
        id="svg5249"
      >
        {data.map((item, index) => {
          return (
            <G
              onPressIn={() => {
                onSelectContinent(item.class);
                selected !== item.class
                  ? setSelected(item.class)
                  : setSelected("");
              }}
            >
              <Path
                fill={
                  selected === item.class
                    ? "#DFAF2B"
                    : colors[item.class] || color
                }
                id={index.toString()}
                d={item.name}
              />
            </G>
          );
        })}
      </Svg>
    </View>
  );
}

